const e=JSON.parse('{"key":"v-52673f70","path":"/reading/algorithm/offer_oriented/AL_DS/09_heap/09.1.html","title":"9.1 堆基础","lang":"zh-CN","frontmatter":{"title":"9.1 堆基础","date":"2023-09-12T00:00:00.000Z","category":["algorithm"]},"headers":[{"level":2,"title":"Reference","slug":"reference","link":"#reference","children":[]}],"readingTime":{"minutes":1.3,"words":390},"filePathRelative":"reading/algorithm/offer_oriented/AL_DS/09_heap/09.1.md","localizedDate":"2023年9月12日","excerpt":"<blockquote>\\n<p>In <a href=\\"https://en.wikipedia.org/wiki/Computer_science\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">computer science</a>, a <strong>heap</strong> is a specialized <a href=\\"https://en.wikipedia.org/wiki/Tree_(data_structure)\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">tree</a>-based <a href=\\"https://en.wikipedia.org/wiki/Data_structure\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">data structure</a> that satisfies the <strong>heap property</strong>: In a <em>max heap</em>, for any given <a href=\\"https://en.wikipedia.org/wiki/Node_(computer_science)\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">node</a> C, if P is a parent node of C, then the <em>key</em> (the <em>value</em>) of P is greater than or equal to the key of C. In a <em>min heap</em>, the key of P is less than or equal to the key of C. The node at the \\"top\\" of the heap (with no parents) is called the <em>root</em> node.</p>\\n</blockquote>"}');export{e as data};
